     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"742815","type":"CustomJS"},{"attributes":{},"id":"742631","type":"BasicTicker"},{"attributes":{},"id":"742816","type":"CrosshairTool"},{"attributes":{"coordinates":null,"formatter":{"id":"742470"},"group":null,"major_label_policy":{"id":"742750"},"ticker":{"id":"742441"},"visible":false},"id":"742440","type":"LinearAxis"},{"attributes":{"coordinates":null,"formatter":{"id":"742801"},"group":null,"major_label_policy":{"id":"742802"},"minor_tick_line_color":null,"ticker":{"id":"742773"}},"id":"742772","type":"LinearAxis"},{"attributes":{"axis":{"id":"742630"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"742633","type":"Grid"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"inc","transform":{"id":"742466"}},"hatch_alpha":{"value":0.1},"hatch_color":{"field":"inc","transform":{"id":"742466"}},"line_alpha":{"value":0.1},"line_color":{"field":"inc","transform":{"id":"742466"}},"top":{"field":"Volume"},"width":{"value":0.8},"x":{"field":"index"}},"id":"742704","type":"VBar"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","line_width":1.5,"x":{"field":"index"},"y":{"field":"equity"}},"id":"742514","type":"Line"},{"attributes":{"coordinates":null,"data_source":{"id":"742464"},"glyph":{"id":"742727"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"742729"},"nonselection_glyph":{"id":
